import TopPageTitle from "../../../../../common/components/topPageTitle/Index";
import { BiSearch } from "react-icons/bi";
import { BsArrowLeft } from "react-icons/bs";
import { IoTimeOutline, IoLocationOutline } from "react-icons/io5";
export const DesignApplication = () => {
  return (
    <>
      <div className="custom_container">
        <PageTop />
        <Application />
      </div>
    </>
  );
};
const PageTop = () => {
  return (
    <>
      <div className="row TotalOpenings_input_main_div g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3">
        <div className="col-xxl-8 col-xl-8 col-lg-8 col-md-6 col-sm-12 col-12">
          <TopPageTitle
            TitleLink={-1}
            TilelIcon={<BsArrowLeft />}
            Name="Design Application"
          />
        </div>
        <div className="col-xxl-4 col-xl-4 col-lg-4 col-md-6 col-sm-12 col-12">
          <div className="TotalOpenings_input_div">
            <span>
              <BiSearch />
            </span>
            <input
              type="email"
              className="form-control w-100"
              placeholder="Search by name, email or department"
            />
          </div>
        </div>
      </div>
    </>
  );
};
const Application = () => {
  return (
    <>
      <div className="design_application_top_div">
        <div className="row">
          <div className="col-6">
            <div className="design_application_name_div">
              <h3>Soham Gupta</h3>
            </div>
          </div>
          <div className="col-6">
            <div className="design_application_time_div">
              <p>
                <span>
                  <IoTimeOutline />
                </span>
                5 Days Ago
              </p>
            </div>
          </div>
          <div className="col-12">
            <div className="row">
              <div className="col-4">
                <div className="design_application_location_div">
                  <p>
                    <span>
                      <IoLocationOutline />
                    </span>
                    Noida
                  </p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
